create table Routes
(
    flight_nr             int     not null
        primary key,
    origin_iata_code      char(3) not null,
    destination_iata_code char(3) not null,
    dep_time              time    not null,
    constraint Flights_Airports
        foreign key (destination_iata_code) references Airports (iata_code),
    constraint Flights_Airports1
        foreign key (origin_iata_code) references Airports (iata_code)
);

